script: |
  super -f text -I q6130.spq | sort > q6130.out

inputs:
  - name: q6130.spq
    data: |
      SELECT 36 FROM tab2 (FORMAT parquet) AS cor0 WHERE + 12 * + - ( - + ( col0 ) ) NOT IN ( + + 30 + - col1 * + col2 );
  - name: tab2

outputs:
  - name: q6130.out
    data: |
      36
      36
      36
